// components/Secret.js
import React from 'react';
import { useSecret } from './SecretContext';

const Secret = () => {
  const { secrets, toggleSecret } = useSecret();

  return (
    <div className="container">
      <h1>Secrets</h1>
      <ul className="list-group">
        {secrets.map((secret) => (
          <li key={secret.id} className="list-group-item d-flex justify-content-between align-items-center">
            {secret.text}
            <input
              type="checkbox"
              checked={secret.found}
              onChange={() => toggleSecret(secret.id)}
            />
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Secret;
